const Display = ({phonebook}) => {
    console.log(phonebook)


    return (
        <table>
            <tr>
                <th>Name</th>
                <th>Phone number</th>
            </tr>
            <tbody>
            {[<tr>
                    <td>{phonebook[0].name}</td>
                    <td>{phonebook[0].number}</td>
            </tr>]}
            {phonebook.map(person => {
                <tr key={person.id}>
                    <td>{person.name}</td>
                    <td>{person.number}</td>
                </tr>
            }
                )}
            </tbody>
        </table>
    )
}

export default Display
